def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return extension.count('A') - extension.count('a')

    strongest = max(extensions, key=strength)
    return f"{class_name}.{strongest}"

def even_odd_count(num):
    even_count = 0
    odd_count = 0
    while num != 0:
        digit = num % 10
        if digit % 2 == 0:
            even_count += 1
        else:
            odd_count += 1
        num //= 10
    return even_count, odd_count

def int_to_mini_roman(number):
    roman_values = {1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'}
    result = ''
    for value in sorted(roman_values.keys(), reverse=True):
        while number >= value:
            result += roman_values[value]
            number -= value
    return result

def find_max(words):
    max_unique_chars = 0
    max_word = ""

    for word in words:
        unique_chars = len(set(word))
        if unique_chars > max_unique_chars or (unique_chars == max_unique_chars and word < max_word):
            max_unique_chars = unique_chars
            max_word = word

    return max_word

def do_algebra(operators, operands):
    result = operands[0]
    for i in range(1, len(operands)):
        if operators[i-1] == '+':
            result += operands[i]
        elif operators[i-1] == '-':
            result -= operands[i]
        elif operators[i-1] == '*':
            result *= operands[i]
        elif operators[i-1] == '//':
            result //= operands[i]
        elif operators[i-1] == '**':
            result **= operands[i]
    return result

import hashlib

def string_to_md5(text):
    if text == '':
        return None
    md5_hash = hashlib.md5()
    md5_hash.update(text.encode())
    return md5_hash.hexdigest()
